contracts/Batcher.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import { IERC20 } from "./IERC20.sol";
import { IIntentVault } from "./Interfaces.sol";
import { IUniswapRouter } from "./IUniswapRouter.sol"; // має містити swapExactTokensForETH(...)

/**
 * @title Batcher
 * @notice MVP: збирає внески USDC, робить один своп USDC->ETH (через WETH-маршрут),
 *         і розкладає claim'и ETH пропорційно внескам.
 */
contract Batcher {
  IERC20 public immutable USDC;
  IUniswapRouter public immutable router;
  IIntentVault public immutable vault;
  address public immutable WETH;
  bytes32 public immutable pairKey;

  uint256 public kTarget;     // мінімум учасників (k-анонімність)
  uint256 public timeoutSec;  // фолбек за часом

  struct BatchSlot {
    uint256 openedAt;
    bool executed;
    uint256 totalIn;   // Σ USDC у батчі
    uint256 totalOut;  // Σ ETH зі свопу
    address[] users;
    mapping(address => uint256) contrib;
    mapping(address => bool) seen;
  }

  mapping(bytes32 => BatchSlot) private _batches; // поточний батч для пари
  uint256 public batchCounter;

  // claimable[batchId][user] = ETH до отримання
  mapping(uint256 => mapping(address => uint256)) public claimable;

  event BatchOpened(bytes32 indexed pair, uint256 openedAt);
  event Contributed(bytes32 indexed pair, address indexed user, uint256 amount);
  event BatchExecuted(bytes32 indexed pair, uint256 indexed batchId, uint256 totalIn, uint256 totalOut, uint256 k);
  event Claimed(uint256 indexed batchId, address indexed user, uint256 amount);

  constructor(
    address usdc,
    address uniRouter,
    address _vault,
    address _weth,
    bytes32 _pairKey,
    uint256 _kTarget,
    uint256 _timeoutSec
  ) {
    USDC = IERC20(usdc);
    router = IUniswapRouter(uniRouter);
    vault  = IIntentVault(_vault);
    WETH   = _weth;
    pairKey = _pairKey;
    kTarget = _kTarget;
    timeoutSec = _timeoutSec;
  }

  // ===== batching API =====

  function openBatch(bytes32 pair) external {
    require(pair == pairKey, "pair mismatch");
    BatchSlot storage b = _batches[pair];
    require(b.openedAt == 0 || b.executed, "already open");

    // скинути слот
    b.openedAt = block.timestamp;
    b.executed = false;
    b.totalIn  = 0;
    b.totalOut = 0;
    delete b.users;

    emit BatchOpened(pair, block.timestamp);
  }

  /// @notice Користувач уносить USDC у відкритий батч (MVP-шлях, без IntentVault)
  function contribute(bytes32 pair, uint256 amount) external {
    require(pair == pairKey, "pair mismatch");
    BatchSlot storage b = _batches[pair];
    require(b.openedAt != 0 && !b.executed, "no open batch");
    require(amount > 0, "zero");

    require(USDC.transferFrom(msg.sender, address(this), amount), "transferFrom fail");

    if (!b.seen[msg.sender]) {
      b.seen[msg.sender] = true;
      b.users.push(msg.sender);
    }
    b.contrib[msg.sender] += amount;
    b.totalIn += amount;

    emit Contributed(pair, msg.sender, amount);
  }

  /// @notice Виконати своп, коли зібрано k або сплив timeout
  function executeBatch(bytes32 pair) external {
    BatchSlot storage b = _batches[pair];
    require(b.openedAt != 0 && !b.executed, "no open batch");
    require(
      b.users.length >= kTarget || block.timestamp >= b.openedAt + timeoutSec,
      "conditions not met"
    );
    require(b.totalIn > 0, "nothing to swap");

    // 1) approve на роутер
    require(USDC.approve(address(router), b.totalIn), "approve failed");

    // 2) Маршрут свопу USDC -> WETH (Uniswap V2); Router повертає ETH на цей контракт
         address[] memory swapPath = new address[](2);  // оголошення масиву
         swapPath[0] = address(USDC);                   // адреса токена USDC
         swapPath[1] = WETH;                            // адреса WETH


    // 3) Своп USDC -> ETH (через WETH)
    uint256[] memory amounts = router.swapExactTokensForETH(
      b.totalIn,
      0,                // для smoke: без мінімуму; у проді — задати slippage
      swapPath,
      address(this),
      block.timestamp + 1200
    );
    uint256 ethOut = amounts[amounts.length - 1];

    // 4) Позначаємо виконання та розкладаємо claim-и
    b.executed = true;
    b.totalOut = ethOut;
    uint256 id = ++batchCounter;

    for (uint256 i = 0; i < b.users.length; i++) {
      address u = b.users[i];
      uint256 part = (ethOut * b.contrib[u]) / b.totalIn;
      claimable[id][u] += part;
    }

    emit BatchExecuted(pair, id, b.totalIn, ethOut, b.users.length);
  }

  /// @notice Користувач забирає свою частку ETH
  function claim(uint256 batchId) external {
    uint256 amt = claimable[batchId][msg.sender];
    require(amt > 0, "nothing");
    claimable[batchId][msg.sender] = 0;

    (bool ok, ) = payable(msg.sender).call{ value: amt }("");
    require(ok, "eth transfer failed");

    emit Claimed(batchId, msg.sender, amt);
  }

  // щоб контракт міг отримувати ETH від роутера
  receive() external payable {}
}

